import Link from "next/link";

const Footer = () => {
  return (
    <div>
      <ul>
        <li>
          <Link href="/"> Twitter</Link>
        </li>
        <li>
          <Link href="/blog"> YouTube</Link>
        </li>
        <li>
          <Link href="/contact"> Instagram</Link>
        </li>
        <li>
          <Link href="/about"> LinkedIn</Link>
        </li>
      </ul>
    </div>
  );
};

export default Footer;
